import  React, { Component, useContext } from "react";
import { Context } from "..";
import { BannerPlayer } from "./components/bannerPlayer";
import { SectionAbout } from "./components/sectionAbout";
import { SectionAwards } from "./components/sectionAwards";
import { SectionGallery } from "./components/sectionGallery";
import { SectionHistory } from "./components/sectionHistory";
import { SectionMoments } from "./components/sectionMoments";
import { SectionRecords } from "./components/sectionRecords";



export const Home = () => {
  const{user}= useContext(Context);
    return(
        
          <body>
            
            <BannerPlayer />
            <SectionAbout />
            <SectionHistory /> 
            <SectionRecords />
            <SectionAwards />
            <SectionGallery />
           {/*  <SectionSkills /> */}
            <SectionMoments />
           {/*  <SectionClient />  */}
          {/*   <SectionBlog /> */}
         {/*  <FetchUrl /> */}
            
    </body>
        
    )
}



class FetchUrl extends Component {

  constructor()
  {
    super();
    this.state={
      data: {},
    }
  }

  componentDidMount()
  {
    fetch('https://cdn.lk-ft.ru/footballers')
    .then((response) => response.json())
    .then((findresponse)=>{
      console.log(findresponse.url)
      this.setState({
        data:findresponse.url,
      })
    })
  }

  
  render(){
  return (
    <div>
    {this.state.data}  
    </div>
  )
}
}
